<!DOCTYPE html>
<html>
	<head>
		<title>The Club | Under Maintenance</title>
		<meta charset="UTF-8">
		<meta name="viewport"
			content="width=device-width, initial-scale=1.0, user-scalable=no">
		<link
			href="https://fonts.googleapis.com/css2?family=Nunito+Sans:wght@400;700&display=swap"
			rel="stylesheet">
	</head>
	<style type="text/css">
	body {
		display: flex;
		flex-direction: column;
		height: 100vh;
		font-family: 'Nunito Sans', sans-serif;
	}
	body,h1,h2,h3,p {
		margin: 0;
		padding: 0;
	}
	#gradient-bar {
		background: rgb(241,90,38);
		background: linear-gradient(90deg, rgba(241,90,38,1) 0%, rgba(229,30,121,1) 43%, rgba(106,45,145,1) 100%);
	}
	.full-screen {
		height: 100vh;
		width: 100%;
		display: flex;
		flex-direction: column;
	}
	.top-bar {
		height: 4px;
		width: 100%;
	}
	.header-section {
		flex: 0 0 auto;
	}
	.header-content {
		display: flex;
		align-items: center;
		height: 80px;
		padding: 0 56px;
		border-bottom: 1px solid #e5e7eb;
	}
	.logo-img {
		height: 19px;
	}
	.main-container {
		width: 100%;
		flex: 1;
		margin-left: auto;
		margin-right: auto;
		display: flex;
		flex-direction: column;
		align-items: center;
		justify-content: center;
		color: #1A1A1A;
	}
	.maintenance-content {
		width: 220px;
		height: 220px;
	}
	.maintenance-img {
		width: 100%;
		height: auto;
	}
	.maintenance-text {
		margin: 24px 0;
		padding:0 16px;
	}
	.text-group {
		margin-bottom: 8px;
	}
	.title-bold {
		font-weight: 700;
		text-align: center;
	}
	.eng-title {
		font-size: 24px;
		line-height: 32px;
	}
	.eng-text {
		font-size: 16px;
		line-height: 22px;
	}
	.text-center {
		text-align: center;
	}

	/* Responsive design for mobile devices */
	@media screen and (max-width: 768px) {
		
		.maintenance-content {
			width: 180px;
			height: 180px;
		}
		/* Mobile-specific styles */
		.header-content {
			height: 60px;
			padding: 0 16px;
		}
		.maintenance-text {
			margin: 16px 0;
		}
		.eng-title {
			font-size: 20px;
			line-height: 26px;
		}
	}
</style>
